    false,nt"url": null,nt"notes": "This report covers the nesting ecology
    of greater white-fronted geese on the Nowitna National Wildlife Refuge. Aerial surveys
    to document spring phenology and waterfowl migration chronology and ground searches
    to locate nests of white-fronted geese and other waterfowl were conducted in 1988
    in floodplain habitats on the Nowitna NWR. The study area and methods and results
    are discussed.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
